INSERT INTO `notice` (`notice_id`, `notice_title`, `notice_content`, `notice_date`) VALUES
	(3, '[판매 공지] 구디샵 추석선물 세트 판매일정 안내', '안녕하세요\r\n\r\n기프티쇼 비즈입니다.\r\n\r\n \r\n\r\n 추석 전 택배 물량 폭주와 재고 소진으로 인하여 [CJ제일제당 추석선물 세트]는 이번주 금요일(25일) 오전까지만 판매될 예정입니다.\r\n\r\n구매 계획이 있으신 고객사 분들은 금요일(25일) 오전까지 구매를 해주시길 부탁 드립니다.\r\n\r\n 추석 전 택배 물량이 많아 기프티쇼 수신 후 금주에 배송지를 입력한 수신자분들은 추석 전 상품 수령이 어려울 수 있으니 참고를 부탁 드립니다.\r\n\r\n감사합니다.\r\n\r\n \r\n\r\n* 대상 상품 리스트\r\n\r\n- CJ제일제당 현명한선택 A-9호\r\n\r\n- CJ제일제당 백설 프리미엄 17호\r\n\r\n- CJ제일제당 현명한선택 A-13호\r\n\r\n- CJ제일제당 현명한선택 A-15호\r\n\r\n- CJ제일제당 스팸 16호\r\n\r\n- CJ제일제당 한뿌리 홍삼대보 24입\r\n\r\n- CJ제일제당 한뿌리 흑삼정 데일리스틱 30입\r\n\r\n- CJ제일제당 한뿌리 흑삼대보 24입', '2020-09-24 11:57:45'),
	(4, '[공모전 공지] 구디샵 디자인 공모전 대회', '구디샵 디자인 공모전 대회', '2020-09-24 11:58:46'),
	(5, '[거래공지] 09.24 농협 은행 거래 제한 안내', '농협은행 점검으로 인해 24일 13시~15시까지 거래가 제한됩니다.', '2020-09-24 11:59:44'),
